script: |
  super -f text -I q8739.spq | sort > q8739.out

inputs:
  - name: q8739.spq
    data: |
      SELECT col0 + - 18 / col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN 66 + - - 68 * - 44 * col1 * col2 AND ( col2 * col0 + + col0 );
  - name: tab0

outputs:
  - name: q8739.out
    data: |
